import React, { useState } from "react";
import { Calendar } from 'primereact/calendar';
import './../App.css';
import { Button } from 'primereact/button';
import { ButtonGroup } from 'primereact/buttongroup';
export default function TouchUIDemo() {
  const [datetime24h, setDateTime24h] = useState(null);
const [dates, setDates] = useState(null);

    return (
      <div className="card flex flex-wrap gap-3 p-fluid">
          <div className="flex-auto">
              <label htmlFor="calendar-24h" className="font-bold block mb-2">
                Выберете время когда будет удобно прийти
              </label>
              <Calendar value={dates} onChange={(e) => setDates(e.value)} value={datetime24h} onChange={(e) => setDateTime24h(e.value)} showTime hourFormat="24" selectionMode="multiple" readOnlyInput />
              <div className="card flex justify-content-center">
                  <ButtonGroup>
                      <Button label="Save" icon="pi pi-check" />
                      <Button label="Delete" icon="pi pi-trash" />
                      <Button label="Cancel" icon="pi pi-times" />
                  </ButtonGroup>
              </div>
          </div>
      </div>
    )
}
